CREATE DATABASE IF NOT EXISTS xy_s1 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;
USE xy_s1;

CREATE TABLE t_game_bug_report (
  bug_id int(11) NOT NULL AUTO_INCREMENT,
  player_id int(11) NOT NULL,
  bug_type int(11) DEFAULT NULL,
  report varchar(200) NOT NULL,
  begin_time datetime NOT NULL,
  bug_status varchar(45) DEFAULT NULL,
  PRIMARY KEY (bug_id),
  KEY player_id_idx (player_id)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=4 ;


CREATE TABLE t_game_player_login_info (
  user_id int(11) NOT NULL,
  login_ip varchar(45) NOT NULL DEFAULT '0',
  is_unusual tinyint(4) NOT NULL DEFAULT '0',
  stop_time datetime DEFAULT NULL,
  PRIMARY KEY (user_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


CREATE TABLE t_game_player_msg_for_person (
  id int(10) unsigned NOT NULL AUTO_INCREMENT,
  sender_id int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发送者ID（如果系统邮件，可确定一个不会被分配的ID）',
  receiver_id int(11) unsigned NOT NULL DEFAULT '0' COMMENT '接收者的ID',
  send_time datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '发送时间',
  message_type tinyint(3) unsigned zerofill NOT NULL DEFAULT '000' COMMENT '邮件类型，分为0:系统消息，1:好友消息，2:pvp消息',
  additional varchar(100) DEFAULT '' COMMENT '附件，没有为空',
  message varchar(1024) DEFAULT '' COMMENT '邮件的具体内容,长度限制512',
  finish_state int(10) unsigned zerofill DEFAULT '0000000000' COMMENT '邮件处理状态, 已领取邮件的值将为领取消息的ID',
  message_title varchar(100) DEFAULT '' COMMENT '邮件标题',
  sender_name varchar(30) DEFAULT '系统管理员' COMMENT '发件人姓名',
  expire_time datetime NOT NULL DEFAULT '2014-09-05 17:13:18' COMMENT '过期时间',
  PRIMARY KEY (id),
  KEY receiver_id (sender_id) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE t_game_user (
  user_id int(11) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  account_id char(80) NOT NULL DEFAULT '0' COMMENT '账户ID',
  account_name varchar(45) DEFAULT 'Test',
  account_type int(11) DEFAULT '0',
  user_name varchar(40) NOT NULL,
  user_avatar_id int(11) NOT NULL DEFAULT '1',
  user_lv smallint(6) NOT NULL DEFAULT '0' COMMENT '等级',
  user_exp int(11) NOT NULL DEFAULT '0' COMMENT '经验',
  user_Currency varchar(200) NOT NULL DEFAULT '0' COMMENT '金币',
  user_Vip_level smallint(6) NOT NULL DEFAULT '0',
  user_Vip_Exp int(11) NOT NULL DEFAULT '0',
  user_Guide_step varchar(50) NOT NULL DEFAULT '0' COMMENT '体力',
  user_Spirit smallint(6) NOT NULL DEFAULT '0' COMMENT '体力',
  user_SkillPoint smallint(6) DEFAULT '0',
  SpiritBoughtTimer tinyint(4) NOT NULL,
  SkillPointBoughtTimer tinyint(4) NOT NULL DEFAULT '0',
  FreeNormalBoxLotteryTimes tinyint(4) NOT NULL DEFAULT '0' COMMENT '免费金币宝箱抽取次数',
  player_reg_time datetime NOT NULL DEFAULT '2000-01-01 12:00:00',
  player_login_time datetime NOT NULL DEFAULT '2000-01-01 12:00:00',
  TimeStruct varchar(500) NOT NULL DEFAULT '0' COMMENT '体力恢复时间',
  UseTimeInfo varchar(500) NOT NULL DEFAULT '0',
  SignStruct varchar(20) NOT NULL DEFAULT '0',
  league_id int(11) unsigned NOT NULL DEFAULT '0',
  LeagueStruct varchar(50) NOT NULL DEFAULT '0',
  RechargeStruct varchar(45) NOT NULL DEFAULT '0',
  t_welkin_reset_time int(11) DEFAULT '1' COMMENT '大闹天宫可重置次数',
  t_welkin_cur_tollgate int(11) DEFAULT '1' COMMENT '关卡进度',
  player_chapter_award char(70) NOT NULL DEFAULT '0',
  PRIMARY KEY (user_id)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=18692 ;

