CREATE TABLE cd_caidan (
  cd_id int(11) NOT NULL AUTO_INCREMENT,
  cd_tag varchar(20) NOT NULL COMMENT '菜单分类标记',
  cd_name varchar(20) NOT NULL COMMENT '菜单名',
  gn_dmid int(11) NOT NULL COMMENT '功能号',
  cd_stat int(11) NOT NULL DEFAULT '1' COMMENT '0:无效，1:正常',
  PRIMARY KEY (cd_id)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=8 ;


CREATE TABLE dj_wupin (
  dj_id int(11) NOT NULL COMMENT '道具ID',
  dj_name varchar(20) NOT NULL COMMENT '道具名称',
  dj_type smallint(6) NOT NULL COMMENT '道具类型',
  dj_adv int(11) NOT NULL COMMENT '道具品质：0白，1绿，2蓝，3紫，4橙',
  PRIMARY KEY (dj_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='道具物品表';


CREATE TABLE ip_dm_xinren (
  ip_dmid smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT '信任ip地址ID',
  ip_pid smallint(5) unsigned NOT NULL COMMENT '信任ip地址pid',
  ip_dizhi varchar(15) NOT NULL COMMENT '信任ip地址ipv4',
  PRIMARY KEY (ip_dmid),
  KEY ip_pid_2 (ip_pid,ip_dizhi)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='信任IP表' AUTO_INCREMENT=4 ;


CREATE TABLE sv_servers (
  sv_id int(11) NOT NULL AUTO_INCREMENT,
  sv_name varchar(50) NOT NULL,
  sv_host varchar(50) DEFAULT NULL,
  sv_dbhost varchar(50) NOT NULL COMMENT '数据库地址端口',
  sv_dbname varchar(20) NOT NULL COMMENT '数据库名',
  sv_dbuser varchar(20) NOT NULL COMMENT '数据库用户名',
  sv_dbpwd varchar(50) NOT NULL COMMENT '数据库密码',
  sv_stat tinyint(4) NOT NULL DEFAULT '1' COMMENT '0:无效，1：有效',
  PRIMARY KEY (sv_id),
  UNIQUE KEY sv_name (sv_name)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=3 ;


CREATE TABLE tbl_demo (
  id int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `name` varchar(20) NOT NULL COMMENT '名称',
  type_id tinyint(4) NOT NULL DEFAULT '1' COMMENT 'demo类型',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'demo状态：0:无效，1:有效',
  PRIMARY KEY (id)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=3 ;


CREATE TABLE tbl_demo_type (
  type_id tinyint(4) NOT NULL COMMENT '类型ID',
  type_name varchar(20) NOT NULL COMMENT '类型名称',
  type_desc varchar(50) NOT NULL COMMENT '类型说明',
  PRIMARY KEY (type_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


CREATE TABLE xt_dm_gongneng (
  gn_dmid int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '功能编号',
  gn_jianjie varchar(100) DEFAULT NULL COMMENT '功能简介',
  gn_kaifa varchar(10) DEFAULT NULL COMMENT '功能开发人',
  gn_ctrl varchar(40) DEFAULT NULL COMMENT 'controller名称：c_shou_ye 写为： shou_ye',
  gn_act varchar(30) DEFAULT NULL COMMENT '操作方法名：action_shou_ye 写为：shou_ye',
  gn_fujia varchar(100) DEFAULT NULL COMMENT '功能的附加参数',
  yz_leixing tinyint(4) NOT NULL DEFAULT '0' COMMENT '验证类型，0:不验证，1:需要登录，2:密钥验证，3:后台执行（不屏蔽echo）',
  ip_pid smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '信任IP表（ip_dm_xinren），0:不验证，其他:需要验证',
  PRIMARY KEY (gn_dmid)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=10000 ;


CREATE TABLE yh_xinxi (
  yhid int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  yh_name varchar(20) NOT NULL COMMENT '用户名',
  yh_passwd varchar(40) NOT NULL COMMENT '密码',
  yh_type tinyint(4) NOT NULL DEFAULT '1' COMMENT '用户类型：0:无效用户，1：普通用户，2:管理员',
  PRIMARY KEY (yhid),
  UNIQUE KEY yh_name (yh_name)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='用户信息' AUTO_INCREMENT=1001 ;


